public class moreThreadJiaohu \{
 public static void main\(String\[\] args\) \{
 //创建两个Hero
 final Hero a \= new Hero\(\)\;
 a\.blood \= 100\;
 a\.name \= "a"\;
 a\.damage \= 1\;
 final Hero b \= new Hero\(\)\;
 b\.blood \= 999\;
 b\.name \= "b"\;
 b\.damage \= 1\;

 for \(int i\=0\;i\<5\;i\+\+\)\{
 new recover\(b\)\.start\(\)\;
 \}

 for \(int j\=0\;j\<2\;j\+\+\)\{
 new reduce\(b\)\.start\(\)\;

 \}
 \}
 //内部类
 static class reduce extends Thread \{
 private Hero hero\;

 public reduce\( Hero hero\) \{
 this\.hero \= hero\;
 \}

 //匿名创建两个线程
 Thread reduce \= new Thread\(\) \{
 \@Override
 public void run\(\) \{
 hero\.reduce\(\)\;
 \}
 \}\;

 \}

 static class recover extends Thread \{
 private Hero hero\;

 public recover\(Hero hero\) \{
 this\.hero \= hero\;
 \}

 Thread recover \= new Thread\(\) \{
 \@Override
 public void run\(\) \{
 hero\.recover\(\)\;
 \}
 \}\;

 \}




\}
